ll rui(ll a,ll b){
    ll ans=1;
    while(b>0){
        if(b&1) ans=ans*a%mod;
        a=a*a%mod;
        b/=2;
    }
    return ans;
}

ll fac[MAX];

struct Lagrange{
    vector<ll> A,C;
    int N;
    
    void init(vector<ll> &a){
        A=a;
        N=si(A)-1;
        C.resize(N+1);
        fac[0]=1;
        for(ll i=1;i<=N;i++){
            fac[i]=fac[i-1]*i%mod;
        }
        
        for(int i=0;i<=N;i++){
            if((N-i)&1) C[i]=A[i]*rui(fac[i]*(mod-fac[N-i])%mod,mod-2)%mod;
            else C[i]=A[i]*rui(fac[i]*fac[N-i]%mod,mod-2)%mod;
        }
    }
    
    ll query(ll T){
        T%=mod;
        if(T<=N) return A[T];
        
        ll base=1;
        for(int i=0;i<=N;i++){
            base*=(T-i);
            base%=mod;
        }
        
        ll res=0;
        for(int i=0;i<=N;i++){
            res+=base*rui(T-i,mod-2)%mod*C[i]%mod;
            res%=mod;
        }
        
        return res;
    }
};

